DO $$ 
DECLARE
    current_date1 TIMESTAMPTZ := '{{components.form1.data.datepicker2.value}}'::timestamptz; 
    current_date2 TIMESTAMPTZ := '{{components.form1.data.datepicker3.value}}'::timestamptz; 
    title TEXT := '{{components.form1.data.textinput1.value}}';
    description TEXT := '{{components.form1.data.textarea1.value}}';
    creator TEXT := 'ajabimahdi3@gmail.com';
    color TEXT := '{{components.form1.data.dropdown3.value}}';
    starttime TEXT := '{{components.form1.data.dropdown2.value}}';
    endtime TEXT := '{{components.form1.data.dropdown1.value}}';
    group_id INTEGER;
    end_rec TIMESTAMPTZ := '{{components.form1.data.datepicker1.value}}'::timestamptz;
    daily BOOLEAN := '{{components.form1.data.checkbox3.value}}';
BEGIN
    SELECT nextval('group_id_sequence') INTO group_id;

    INSERT INTO calendar_event (start, "end", title, description, creator, color, starttime, endtime, group_id, end_rec, daily)
    SELECT 
        d::timestamptz, 
        current_date2 + (d - current_date1)::interval,
        title, 
        description, 
        creator, 
        color,
        starttime,
        endtime,
        group_id,
        end_rec,
        daily
    FROM generate_series('{{components.form1.data.datepicker2.value}}'::timestamptz, '{{components.form1.data.datepicker1.value}}'::timestamptz, '1 day'::interval) d;
END $$;

